import React , { Component } from 'react';
import './App.css';
import Header from './components/header' 
import ContactForm from './components/contactForm' 

class App extends Component {
    render() {
      return (
        <div className="jumbotron">
            <Header />
            <ContactForm  /> 
        </div>
      );
    }
  }

  export default App;
